define({"topics" : [{"title":"Adding properties","shortdesc":"\n               <p class=\"shortdesc\">You can use the <span class=\"keyword cmdname\">-add</span> command to add properties to users, hosts,         and applications.\n               </p>\n            ","href":"adding_properties.html","attributes": {"data-id":"adding_properties",},"menu": {"hasChildren":false,},"tocID":"adding_properties-d66e1383","topics":[]},{"title":"Deleting properties","shortdesc":"\n               <p class=\"shortdesc\">You can use the <span class=\"keyword cmdname\">propertymgr -delete</span> command to delete a property         from any type of entity. You must specify the logical name of the property, and the\n                  entity         type. \n               </p>\n            ","href":"deleting_properties.html","attributes": {"data-id":"deleting_properties",},"menu": {"hasChildren":false,},"tocID":"deleting_properties-d66e1397","topics":[]},{"title":"Listing properties","shortdesc":"\n               <p class=\"shortdesc\">You can use the <span class=\"keyword cmdname\">propertymgr -list</span> command to display a list of all         properties currently defined for all three entity types.\n               </p>\n            ","href":"listing_properties.html","attributes": {"data-id":"listing_properties",},"menu": {"hasChildren":false,},"tocID":"listing_properties-d66e1411","topics":[]}]});